
class Solution:
    def threeSum(self, nums):
        length = len(nums)
        if length == 0:
            return []

        nums = sorted(nums)
        prev, result, seen = None, [], set()
        for index, num in enumerate(nums):
            if prev and prev == num:
                continue
            prev = num
            i, j = index + 1, length - 1
            while i < j:
                current = num + nums[i] + nums[j]
                if current == 0:
                    key = "{}#{}#{}".format(num, nums[i], nums[j])
                    if key not in seen:
                        result.append([num, nums[i], nums[j]])
                        seen.add(key)
                    left, right = nums[i], nums[j]
                    while i < j and nums[i] == left:
                        i = i + 1
                    while i < j and nums[j] == right:
                        j = j - 1
                elif current > 0:
                    j = j - 1
                else:
                    i = i + 1
        return result


